import React from 'react';
import Storm from '../Storm.png'
import './Team.css'
import { Card } from 'semantic-ui-react'

const Members = [
    {
        name: 'STORM#2856',
        avatar: Storm,
    },
    {
        name: '블랙카이#2583',
        avatar: 'https://cdn.discordapp.com/avatars/734560292024877056/6e6a68e216a05ea4d15f72226f6981b5.png?size=256',
    },
]

function Team() {
    return (
        <div className='Team'>
            {Members.map(({ name, avatar }) => (
                <>
                    <img src={avatar} alt={name} />
                    <h2>{name}</h2>
                    <Card>

                    </Card>
                </>
            ))}
        </div>
    );
}

export default Team;
